import Header from './Header.js';
import Main from './Main.js';
import PopupWithForm from './PopupWithForm.js';
import Footer from './Footer.js';
import '../index.css';

function App() {
    function handleEditAvatarClick() {
        const popupAvatar = document.querySelector('#popup-avatar-edit');
            popupAvatar.classList.add('popup_active');
    };
    function handleEditProfileClick() {
        const popupEdit = document.querySelector('#popup-edit');
            popupEdit.classList.add('popup_active');
    };

    function handleAddPlaceClick() {
        const popupAddPlace = document.querySelector('#popup-add');
            popupAddPlace.classList.add('popup_active');
    };
  return (
    <div className="page">
        <Header />
        <Main 
        onEditProfile={handleEditProfileClick}
        onAddPlace={handleAddPlaceClick}
        onEditAvatar={handleEditAvatarClick}
        />
        <PopupWithForm 

        />


        <template id="new-card">
            <li className="card">
                <img className="card__image" src="/" alt="" />
                <button className="card__remove" type="button"></button>
                <div className="card__container">
                    <h2 className="card__name"></h2>
                    <div className="card__like-container">
                        <button className="card__like" type="button"></button>
                        <h3 className="card__like-count"></h3>
                    </div>
                </div>
            </li>
        </template>

        <Footer />

    </div>
  );
}

export default App;
